import ExpenseItem from './ExpenseItem'

function Expenses() {
    const expenses = [{
        date: new Date(),
        amount: 150.23,
        title: 'Car Insurance'
    },
    {
        date: new Date(),
        amount: 500.69,
        title: 'Term Life'
    },
    {
        date: new Date(),
        amount: 160.13,
        title: 'Health'
    },
    {
        date: new Date(),
        amount: 160.13,
        title: 'LIC'
    }]
    return (
        <div>
            <ExpenseItem date={expenses[0].date} title={expenses[0].title} amount={expenses[0].amount} />

        </div>
    )
}

export default Expenses;
